import React from "react";
import {Text, StyleSheet,View} from '@react-native';


export default class Home extends Components {
    render(){
        return(
            <Block>
                <Text hi light>Home</Text>
            </Block>
        )
    }
}

const style=StyleSheet.create({
    header: {
        marginTop: 20,
        flexDirection: 'row',
        justifyContent: 'space-between',
    }
})
